    {
        if eq(value, not(0)) { panic_error_0x11() }
        ret := add(value, 1)
    }
    function negate_t_int256(value) -> ret
    {
        if eq(value, shl(255, 1)) { panic_error_0x11() }
        ret := sub(ret, value)
    }
    function panic_error_0x11()
    {
        mstore(0, shl(224, 0x4e487b71))
        mstore(4, 0x11)
        revert(0, 0x24)
    }
    function panic_error_0x41()
